import React from 'react';
import Link from 'next/link'


const fakeData = [
  {
    id: 1,
    name: "ມັງພຸດ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 105,
    imageUrl:'https://www.pexels.com/photo/healthy-apple-fruits-natural-102104/'
  },
  {
    id: 2,
    name: "ລຳໄຍ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 125,
    imageUrl:'https://www.pexels.com/photo/healthy-apple-fruits-natural-102104/'
  },
  {
    id: 3,
    name: "ທຸເລືອນ",
    description: "ຜົນລະໄມ້ທີກູຍັງງົງຄົນກິນມັນໄດ້ແນວໃດ",
    price: 135,
    imageUrl:'https://www.pexels.com/photo/healthy-apple-fruits-natural-102104/'
  }
]
function products() {
  return (
    <div style={{display:'flex', justifyContent: 'space-around', alignItems:'center', marginTop: '40px'}}>
      {fakeData.map(prod => 
          <div  key={prod.id}>
            <Link href='/products/product_detail' as={`/products/${prod.id}`}>
              <a>
              <img src={prod.imageUrl} alt={prod.description} width="250px"/>
              </a>
            </Link>   
          </div> 
      )}
    </div>
  )
}

export default products
